import logo from './logo.svg';
import './App.css';
import { Unity, useUnityContext } from "react-unity-webgl";

function App() {

  const { unityProvider, sendMessage, addEventListener, removeEventListener, loadingProgression,isLoaded } = useUnityContext({
    loaderUrl: "../RaceCarTyping/Build/RaceCarTyping.loader.js",
    frameworkUrl: "../RaceCarTyping/Build/RaceCarTyping.framework.js",
    dataUrl: "../RaceCarTyping/Build/RaceCarTyping.data",
    codeUrl: "../RaceCarTyping/Build/RaceCarTyping.wasm"
  });

  return (
    <div className="App">
      <h2>Utilisation de react-unity-webgl</h2>
    </div>
  );
}

export default App;
